import Foundation
@testable import web3

class EthereumLogData {
    private let ethereumLog = Data(base64Encoded: """
    
    """)!

    public var ethLogs: [EthereumLog] {
        let etl = try! JSONDecoder().decode(JSONRPCResult<[EthereumLog]>.self, from: self.ethereumLog)
        return etl.result
    }
}
